import './App.css';

import SearchBar from './components/SearchBar';
import Results from './components/Results';



function App() {
  this.state = {
    data: 'foo'
  };



  return (
    <div className="App">
      <header className="App-header">
      <SearchBar />
      <Results data={this.state.data} />
        <p>
          Edit <code>src/App.js</code> and shave to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        </a>
      </header>
    </div>
  );
}

export default App;
